import React from "react";
import "./header.css";

import { Container, Row } from "reactstrap";
const Header = () => {
  return (
    <header>
      <Container>
        <Row>
          <div className="nav_wrapper"></div>
        </Row>
      </Container>
    </header>
  );
};

export default Header;
